"PEMERINTAH DAERAH KABUPATEN BANDUNG BARAT SERAHKAN SK PENETAPAN OBSERVATORIUM BOSSCHA DAN GUA PAWON SEBAGAI CAGAR BUDAYA PERINGKAT KABUPATENâ€.

Dinas Pariwisata dan Kebudayaan Kabupaten Bandung Barat yang diwakili oleh Kepala Bidang Kebudayaan, Usup Suherman, S.Sn.,M.Si menyerahkan SK Bupati Bandung Barat terkait penetapan 2 (dua) Cagar Budaya kepada Pemerintah Provinsi Jawa Barat yang diterima oleh Kepala Bidang Kebudayaan Dinas Pariwisata dan Kebudayaan Provinsi Jawa Barat Dra. Febiyani, M.Pd, Selasa, 18 Januari 2022 di Kantor Dinas Pariwisata dan Kebudayaan Provinsi Jawa Barat.

2 (dua) SK tersebut yaitu SK no. 188.45/Kep.731-Disparbud/2021. Tentang Penetapan Observatorium Bosscha Sebagai Bangunan Cagar Budaya dan SK no. 188.45/Kep.735-Disparbud/2021. Tentang Penetapan Gua Pawon Sebagai Situs Cagar Budaya, dengan demikian 2 (dua) Cagar Budaya tersebut telah memiliki status sebagai Cagar Budaya Peringkat Kabupaten.

Febiyani, menyampaikan apresiasi yg setinggi-tingginnya kepada Pemerintah Kabupaten Bandung Barat, beserta jajaran Dinas Pariwisata dan Kebudayaan dan TACB Kabupaten Bandung Barat atas komitmennya terhadap implementasi UU 11 tahun 2021 tentang Cagar Budaya dan bahwa â€œPihak Pemerintah Daerah Kabupaten Bandung Barat dapat mengusulkan pemeringkatan kedua Cagar Budaya tersebut untuk dikaji oleh TACB Provinsi Jawa Barat dan diusulkan pemeringkatannya menjadi Cagar Budaya Peringkat Provinsiâ€. 

